function writetitle() {
    if (jxplayer('fresh_player').getState() == "PLAYING") {
        if (cf) {
            cd--;
            if (cd < 0) {
                clearTimeout(title_time);
                title_time = setTimeout("writetitle()", title_pause);
                cf = false;
            } else {
                clearTimeout(title_time);
                title_time = setTimeout("writetitle()", title_speed);
            }
        } else {
            cd++;
            if (cd > cur_track_title.length - cs) {
                clearTimeout(title_time);
                title_time = setTimeout("writetitle()", title_pause);
                cf = true;
            } else {
                clearTimeout(title_time);
                title_time = setTimeout("writetitle()", title_speed);
            }
        }
        document.title = '>' + cur_track_title.substring(cd, cs + cd) + '<';
    } else {
        cd = 0;
        cf = false;
        document.title = origtitle;
    }
}

