function start_theme(){
    $("#fresh_player").html('Запускается...');
    html_attach = $("legend:contains('Вложения')~").html().replace(/(^.*?)$\r?\n?/mg, "$1");
    while ((regex_array = regex_attachment_theme.exec(html_attach)) != null) {
            array_temp.push({
                'id': regex_array[2],
                'title': regex_array[1]
            });

        }
    for (j = array_temp.length - 1; j >= 0; j--) {
        track_link_lo = site + 'attachment.php?prelisten=' + array_temp[j].id;
        track_link_hi = site + 'attachment.php?attachmentid=' + array_temp[j].id;
        track_title = array_temp[j].title;
        track_thread = array_showthread[i];
        track_image = site + 'spectrogram.php?fid=' + array_temp[j].id + '.jpg';
        array_playlist.push({
            'sources': [{
                'file': track_link_lo,
                label: '96kbps',
                'type': 'mp3',
                'default': 'true'
            }, {
                'file': track_link_hi,
                label: '320kbps',
                'type': 'mp3'
            }],
            'title': track_title,
            image: track_image,
            'mediaid': track_thread
        });
        playlist_m3u += "\n#EXTINF:0," + track_title + "\n" + track_link_lo;
    }
    start_player(300,100);
}

