function start() {
    $("#fresh_player").html('Запускается...');

    
    while ((regex_array = regex_id.exec($("#threadslist").html())) != null) {
        id = regex_array[1];
        style_name = (regex_array=regex_style.exec($("#threadslist").html()))!=null?regex_array[1]:'Unknown';
        array_style.push("[" + style_name + "] ");
        array_showattach.push(site + "misc.php?do=showattachments&t=" + id);
        array_showthread.push(id);
        count++;
    }
    for (i = 0; i < count; i++) {
        html_attach = $.ajax({
            url: array_showattach[i],
            async: false
        }).responseText;
        array_temp.length = 0;
        while ((regex_array = regex_attachmentid.exec(html_attach)) != null) {
            array_temp.push({
                'id': regex_array[1],
                'title': regex_array[2]
            });

        }
        for (j = array_temp.length - 1; j >= 0; j--) {
            track_link_lo = site + 'attachment.php?prelisten=' + array_temp[j].id;
            track_link_hi = site + 'attachment.php?attachmentid=' + array_temp[j].id;
            track_title = array_style[i] + array_temp[j].title;
            track_thread = array_showthread[i];
            track_image = site + 'spectrogram.php?fid=' + array_temp[j].id + '.jpg';
            array_playlist.push({
                'sources': [{
                    'file': track_link_lo,
                    label: '96kbps',
                    'type': 'mp3',
                    'default': 'true'
                }, {
                    'file': track_link_hi,
                    label: '320kbps',
                    'type': 'mp3'
                }],
                'title': track_title,
                image: track_image,
                'mediaid': track_thread
            });
            playlist_m3u += "\n#EXTINF:0," + track_title + "\n" + track_link_lo;
        }
    }
    start_player(700,400);
}


